import React from "react"
import ReactDOMClient from "react-dom/client"
import './menue2.css'
import { ShowUserInfo, userPage } from '../userpage.js'

const Menue2 = ({header, items, active, setActive, g}) => {

    if(g === "1") {
        function showw() {
            const userSettings = ReactDOMClient.createRoot(document.getElementById("userInformation"));
            userSettings.render(<ShowUserInfo u={userPage} />);
          }

        return (
            <div className={active ? 'menue2 active' : 'menue2'} onClick={() => setActive(false)}>
                <div className="blur"/>
                <div className="menue_context" onClick={e => e.stopPropagation()}>
                    <div className="menue_header">{header}</div>
                    <ul>
                        {items.map(item => 
                        <li>
                            <p onClick={showw}>{item.value}</p>
                            <span className="material-icons">{item.icon}</span>
                        </li>
                    )}
                    </ul>
                </div>
            </div>
        )
    }
}

export default Menue2;
